import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron'
import video from './videos/dna3.mp4'
import Tab from 'react-tabs'
import Tabs from 'react-tabs'
import './App.css';

const Video = () => {
  return (
    <div className="container">
      <video autoPlay playsInline muted src={video} loop="true" />
    </div>
  );
};

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Jumbotron>
          <h1>Bioinformatics:
            <p3> Learning Tools <Video /></p3>
          </h1>
          </Jumbotron>
        <Tabs>
          <TabList>
            <Tab>Description</Tab>
            <Tab>GC content</Tab>
          </TabList>
        </Tabs>
      </header>
    </div>

  );
}

export default App;
